import Nav from './Nav';
import logo from './logo.svg';

function Header(){
    const styles = {
        width: "50px"
    }
    const headstyle = {
        display: "flex",
        alignItems
    }
    return (
        <header style={headstyle}>
            <img src={logo} style={styles}></img>
            <Nav/>
        </header>
    )
}

export default Header;
